Grüße Beschwörer,

wir von Ascended eSports sind noch auf der Suche nach einem Jungler aus der Platin-Elo, mit dem man an der Summoners-INN-League und anderen Turnieren teilnehmen könnte. Falls du ehrgeizig, kritikfähig und ein Teamplayer bist und außerdem noch über ein funktionierendes Headset verfügst, dann melde dich doch mal auf dem TS: ts.sumforce.de oder gleich im League-Client bei Viølet Raven. Alles weitere besprechen wir dann, jedoch werden wir um einzelne Tryout-Spiele nicht herumkommen! Wir freuen uns auf eure Bewerbungen!

